const firstVariant = (arrayOfObjects, key) => {
  const lowestVal = arrayOfObjects.reduce((prevVal, currVal) =>
    prevVal[key] > currVal[key] ? currVal[key] : prevVal[key]
  );
  const object = arrayOfObjects.find( el => el[key] === lowestVal)

  return object
};

export default firstVariant
